function BackEndTest(){

    function postDataToServer() {
        // URL of your Spring Boot endpoint
        const apiUrl = 'http://localhost:8080/api/items';

        // Sample data to be sent to the server
        const data = {
          name: 'Sample Item',
        };

        function getCookie(name) {
            const cookieString = document.cookie;
            const cookies = cookieString.split('; ');

            for (const cookie of cookies) {
                console.log(cookie)
                const [cookieName, cookieValue] = cookie.split('=');
                if (cookieName === name) {
                    return decodeURIComponent(cookieValue);
                }
            }

            return null;
        }

        // Make a POST request to the server
        fetch(apiUrl, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${getCookie("access_token")}`
          },
          body: JSON.stringify(data),
        })
          .then(response => response.json())
          .then(responseData => {
            // Assuming your server returns the saved item data
            console.log('Data saved successfully:', responseData);

            // You can now set the data on your UI or perform any other action
            // For simplicity, let's log it to the console
            // Replace this with your actual UI update logic
          })
          .catch(error => {
            console.log(getCookie("access_token"))
            console.error('Error:', error);
          });
      }

      // Call the function to trigger the POST request
      postDataToServer();

    return (
        <>
            <button onClick={postDataToServer}>test</button>
        </>
    )
} export default BackEndTest

